import React,  { useEffect, useState } from 'react'
import axios from 'axios';

const Dummy = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8081/dummy')
        .then(response => {
            setData(response.data);
        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });
    }, []);

    return (
        <>
            <div>
                <h1>MySQL Table Data</h1>
                <table border="1">
                    <thead>
                    <tr>
                        <th>Column1</th>
                        <th>Column2</th>
                        {/* Add more columns as needed based on your table structure */}
                    </tr>
                    </thead>
                    <tbody>
                    {data.map(row => (
                        <tr key={row.id}>
                        <td>{row.column1}</td>
                        <td>{row.column2}</td>
                        {/* Add more columns as needed based on your table structure */}
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
        </>

    )
}

export default Dummy
